import { GoogleMap, useJsApiLoader } from '@react-google-maps/api';
import React , {Components} from "react"

const google = window.google;
function initialize(){

  function success(position) {
    var latitude  = position.coords.latitude;
    var longitude = position.coords.longitude;
    var yourmap = {
        center:new google.maps.LatLng(latitude  ,longitude),
        zoom:11,
        mapTypeId:google.maps.MapTypeId.ROADMAP
    };
    var map=new google.maps.Map(document.getElementById("googleMap"), yourmap);
    var marker=new google.maps.Marker({
    position:new google.maps.LatLng(latitude  ,longitude),
    });

    marker.setMap(map);
    var infowindow = new google.maps.InfoWindow({
      content:"current position"
    });

    infowindow.open(map,marker);
  };

  function error() {
    alert('error');
  };

  var geo_options = {
    enableHighAccuracy: true, 
    maximumAge        : 30000, 
    timeout           : 27000
  };

  if ("geolocation" in navigator) {
    navigator.geolocation.watchPosition(success, error,geo_options );
  }else{
    alert('error');
  }
};


const containerStyle = {
  width: '1400px',
  height: '800px'
};

const center = {
  lat: 25.013625, 
  lng: 121.540470
};

function MyComponent() {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyAj6NGGgE6guMZsGqLod-WTNXcJGwq-DAs"
  })

  return isLoaded(
    google.maps.event.addListener(window, 'load', initialize)
  )

}

export default MyComponent;
